  return (
    <div className={stylePackages.bodyPackages}>
      <h3>s</h3>
      <p>hs</p>
      <section className={stylePackages.sectionContainer}>
        <CardsPackagesComp />
      </section>
    </div>
  );
};

export default Packages;
